Descripción:
Es un tubo de acero recubierto con una capa de zinc para protegerlo contra la corrosión y garantizar su durabilidad en diferentes aplicaciones. Este tubo tiene un diámetro nominal de 6" y es ampliamente utilizado en instalaciones eléctricas , sistemas de tuberias y estructuras metalicas.

Una opción confiable y resistente para diversas aplicaciones donde se requiere una conducción segura y protegida de cables, fluidos o montaje de estructuras. Su recubrimiento de zinc garantiza su protección contra la corrosión, asegurando un rendimiento Duradero en diferentes entornos.

